var clock=new Worker("./js/time.js"),Display=function(n){var o=this;return o.selections=n,n.forEach(n=>{o[n]=document.querySelector(".date--"+n)}),o};Display.prototype.showTime=function(n){var o=this,e=n;o.selections.forEach(n=>{var s=o[n];s.innerHTML!=e[n]&&(s.innerHTML=e[n])})};var countdown=new Display(["months","days","hours","minutes","seconds"]);clock.onmessage=function(n){countdown.showTime(n.data)};